import React from 'react';
import { useNavigate } from 'react-router-dom';
import Parse from 'parse';

const Dashboard = () => {
  const navigate = useNavigate();
  const currentUser = Parse.User.current();

  // Logout ·Äú·ÄØ·Äï·Ä∫·Äê·Ä≤·Ä∑ Function
  const handleLogout = async () => {
    try {
      await Parse.User.logOut();
      navigate('/login');
    } catch (error) {
      alert("Logout Failed: " + error.message);
    }
  };

  // Login ·Äô·Äù·ÄÑ·Ä∫·Äë·Ä¨·Ä∏·Äõ·ÄÑ·Ä∫ ·Äï·Ä±·Ä∏·Äô·ÄÄ·Äº·Ää·Ä∑·Ä∫·Äê·Ä≤·Ä∑ Logic
  if (!currentUser) {
    return (
      <div style={{ 
        backgroundColor: '#0a192f', height: '100vh', color: '#ff4b2b', 
        display: 'flex', justifyContent: 'center', alignItems: 'center', flexDirection: 'column' 
      }}>
        <h2>ACCESS DENIED</h2>
        <p>Please login to access your dashboard.</p>
        <button 
          onClick={() => navigate('/login')} 
          style={{ 
            marginTop: '20px', padding: '10px 20px', color: '#00ff41', 
            background: 'transparent', border: '1px solid #00ff41', cursor: 'pointer' 
          }}
        >
          Go to Login
        </button>
      </div>
    );
  }

  return (
    <div style={{ backgroundColor: '#0a192f', minHeight: '100vh', color: '#ccd6f6', padding: '20px' }}>
      {/* Dashboard Header */}
      <nav style={{ 
        display: 'flex', justifyContent: 'space-between', 
        borderBottom: '1px solid #00ff41', paddingBottom: '10px', alignItems: 'center' 
      }}>
        <h2 style={{ color: '#00ff41', margin: 0 }}>STUDENT DASHBOARD</h2>
        <button 
          onClick={handleLogout} 
          style={{ 
            background: 'transparent', color: '#ff4b2b', border: '1px solid #ff4b2b', 
            cursor: 'pointer', borderRadius: '5px', padding: '5px 15px' 
          }}
        >
          LOGOUT
        </button>
      </nav>

      {/* Welcome Section */}
      <div style={{ marginTop: '40px' }}>
        <h3 style={{ fontSize: '1.8rem' }}>
          Welcome back, <span style={{ color: '#00ff41' }}>{currentUser.get('username')}</span> üêß
        </h3>
        <p style={{ color: '#8892b0' }}>Your cyber security journey continues here.</p>

        {/* Course Cards in Dashboard */}
        <div style={{ 
          display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))', 
          gap: '20px', marginTop: '30px' 
        }}>
          {/* Linux Course Item */}
          <div style={styles.courseItem}>
            <h4 style={{ color: '#00ff41', marginTop: 0 }}>Linux for Hackers</h4>
            <p style={{ fontSize: '0.9rem' }}>Progress: <span style={{color: '#00ff41'}}>45% Completed</span></p>
            <div style={styles.progressBar}><div style={{...styles.progress, width: '45%'}}></div></div>
            <button style={styles.playBtn}>Continue Lesson</button>
          </div>

          {/* Network Course Item */}
          <div style={{ ...styles.courseItem, borderLeft: '4px solid #8892b0', opacity: 0.7 }}>
            <h4 style={{ color: '#ccd6f6', marginTop: 0 }}>Network Pentesting</h4>
            <p style={{ fontSize: '0.9rem' }}>Status: <span style={{color: '#8892b0'}}>Locked</span></p>
            <button style={{ ...styles.playBtn, background: '#233554', cursor: 'not-allowed' }} disabled>
              Waiting for Approval
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

// Internal Styles
const styles = {
  courseItem: { 
    background: '#112240', padding: '25px', borderRadius: '12px', 
    borderLeft: '4px solid #00ff41', boxShadow: '0 10px 30px rgba(0,0,0,0.3)' 
  },
  progressBar: { width: '100%', height: '8px', background: '#0a192f', borderRadius: '10px', margin: '15px 0' },
  progress: { height: '100%', background: '#00ff41', borderRadius: '10px' },
  playBtn: { 
    width: '100%', padding: '12px', marginTop: '10px', background: '#00ff41', 
    border: 'none', color: '#0a192f', fontWeight: 'bold', cursor: 'pointer', borderRadius: '5px' 
  }
};

export default Dashboard;
